tables.table_schema:
CREATE TABLE health_data (
    user_id INT,
    timestamp TIMESTAMP,
    heart_rate INT,
    steps INT
);

CREATE TABLE wellness_insights (
    user_id INT,
    timestamp TIMESTAMP,
    insight TEXT
);

CREATE TABLE user_data (id INT PRIMARY KEY, name VARCHAR(255), age INT, height FLOAT, weight FLOAT);
CREATE TABLE heart_rate_data (id INT PRIMARY KEY, user_id INT, timestamp TIMESTAMP, heart_rate INT);
CREATE TABLE sleep_data (id INT PRIMARY KEY, user_id INT, date DATE, duration_hours INT);
CREATE TABLE step_count_data (id INT PRIMARY KEY, user_id INT, date DATE, steps INT);

CREATE TABLE sleep_data (
    user_id UUID,
    timestamp TIMESTAMP,
    duration_hours INT,
    sleep_quality INT
);

CREATE TABLE wellness_insights (
    user_id UUID,
    timestamp TIMESTAMP,
    insight_text TEXT
);
